.nav-bar {
  position: fixed;
  top: 0;
  left: 0;
  bottom: 0;
  padding-top: 160px;
  z-index: 11;
  width: 60px;
  background: linear-gradient(to bottom, #333, #444, #555, #666, #999);
  box-shadow: inset -2px 0 4px 0 rgba(0, 0, 0, 0.59);
}

.nav-bar__logo {
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  padding: 8px 6px;
}

.nav-bar__logo img {
  max-width: 104%;
}

.nav-bar__item {
  position: relative;
  margin: 20px 0;
  padding-right: 3px;
  font-size: 34px;
  color: #ffffff;
  text-align: center;
  cursor: pointer;
  border-left: 3px solid transparent;
}

.nav-bar__item.active {
  border-color: #1FBDD0;
}

.nav-bar__item:hover {
  color: #CCD6DD;
}

.nav-bar__item:focus {
  outline: none;
}

.nav-bar__item-tooltip {
  position: absolute;
  top: 50%;
  left: calc(100% - 6px);
  transform: translate(0, -50%);
  padding: 3px 6px;
  font-size: 12px;
  background-color: #363C4A;
  border-radius: 3px;
  transition: opacity .2s 0s, transform .2s 0s, visibility .2s 0s;
}

.nav-bar__item:hover .nav-bar__item-tooltip {
  transition: opacity .2s .5s, transform .2s .5s, visibility .2s .5s;
}

.nav-bar__item:not(:hover) .nav-bar__item-tooltip {
  opacity: 0;
  visibility: hidden;
  transform: translate(-20%, -50%);
}

.nav-bar__item-tooltip::after {
  position: absolute;
  top: 50%;
  left: -6px;
  transform: translateY(-50%);
  width: 0;
  height: 0;
  border-top: 6px solid transparent;
  border-bottom: 6px solid transparent;
  border-right: 6px solid #363C4A;
  content: '';
}

.nav-bar__version {
  font-size: smaller;
  color: #EFF3F5;
  overflow: hidden;
  text-align: center;
}

.nav-bar.nav-bar--compact .nav-bar__logo img {
  display: block;
  max-width: 85%;
  margin: 0 auto;
}

.nav-bar.nav-bar--compact .nav-bar__item {
  margin: 10px 0;
  font-size: 25px;
}

.layout {
  overflow: hidden;
}

.layout__loader {
  background-color: rgba(73, 87, 99, 0.4);
  position: fixed;
  left: 0;
  top: 0;
  right: 0;
  bottom: 0;
  z-index: 999999;
}

.layout__loader .loader-inner {
  left: 50%;
  position: absolute;
  bottom: 50%;
  transform: translateX(-50%) translateY(-50%);
}

.layout__loader .loader-inner > div {
  background: #F07A51;
}

.Toastify__toast-container {
  z-index: 9999;
  -webkit-transform: translate3d(0, 0, 9999px);
  position: fixed;
  padding: 4px;
