.argo-dropdown {
  display: inline-block;
}

.argo-dropdown__anchor {
  cursor: pointer;
}

.argo-dropdown__content {
  position: fixed;
  z-index: 21;
  padding: 1rem;
  background-color: #ffffff;
  box-shadow: 0 0 4px rgba(0, 0, 0, 0.2);
  transition: opacity .2s, transform .2s, visibility .2s;
}

.argo-dropdown__content:not(.opened) {
  transform: translateY(-30%);
  opacity: 0;
  visibility: hidden;
  transition: opacity .2s, transform .2s .2s, visibility .2s;
}

.argo-dropdown__content.is-menu {
  overflow: auto;
  max-height: 360px;
  padding: 0;
  border: 0;
}

.argo-dropdown__content.is-menu ul {
  margin: 0;
  list-style-type: none;
  white-space: nowrap;
  text-align: left;
  cursor: pointer;
  min-width: 150px;
}

.argo-dropdown__content.is-menu ul li {
  padding: 0.5em 1em;
  font-size: 14px;
  border-bottom: 1px solid #EFF3F5;
  color: #6D7F8B;
  cursor: pointer;
}

.argo-dropdown__content.is-menu ul li i {
  margin-right: 2px;
}

.argo-dropdown__content.is-menu ul li:hover {
  background-color: #F8FBFB;
}

.argo-dropdown__content.is-menu ul li:last-child {
  border-bottom: none;
}

.top-bar {
  line-height: 50px;
  background: #ffffff;
  transition: right .5s;
  border-bottom: 1px solid #EFF3F5;
}

.top-bar__left-side {
  padding-left: 20px;
  white-space: nowrap;
}

.top-bar__right-side {
  padding-right: 20px;
  text-align: right;
}

.top-bar__title {
  float: left;
  font-weight: 500;
  font-size: .925em;
  color: #006F8A;
  text-transform: uppercase;
}

.top-bar__filter-item a {
  color: #6D7F8B;
  font-size: 1em;
}

.top-bar__filter {
  position: relative;
}

.top-bar__filter--selected::before {
  position: absolute;
  top: 15px;
  right: 10px;
  width: 8px;
  height: 8px;
  border-radius: 50%;
  background-color: #009BFF;
  content: '';
}

.top-bar__breadcrumbs {
  float: left;
  margin-left: -4px;
  height: 50px;
  font-weight: 500;
  font-size: .8em;
  color: #363C4A;
}

.top-bar__breadcrumbs a {
  display: inline-block;
  padding: 4px;
  line-height: 1.23;
  font-weight: 400;
  color: #00A2B3;
  border-radius: 3px;
}

.top-bar__breadcrumbs a:hover {
  background-color: #EFF3F5;
}

.top-bar__breadcrumbs-last-item {
  display: inline-block;
  padding: 0 4px;
}

.top-bar__sep {
  display: inline-block;
  vertical-align: middle;
  margin: 0 8px;
  width: 0;
  height: 24px;
  border-left: 1px solid #CCD6DD;
  transform: rotate(24deg);
}

.page {
  padding-left: 60px;
  padding-top: 50px;
}

.page__content-wrapper {
  position: relative;
  display: block;
  min-height: calc(100vh - 50px);
  margin: 0 auto;
  overflow: hidden;
}

.page__top-bar {
  position: fixed;
  top: 0;
  right: 0;
  left: 60px;
  height: 50px;
  z-index: 9;
}

.page--has-toolbar {
  padding-top: 100px;
}

.page--has-toolbar .page__top-bar {
  height: 100px;
}

.page--has-toolbar .page__content-wrapper {
  min-height: calc(100vh - 2 * 50px);
}

@keyframes wavemove {
  from {
    left: -100%;
  }

  to {
    left: 100%;
  }
}

.mockup-list__item {
  position: relative;
  overflow: hidden;
  font-size: .875em;
  color: #6D7F8B;
  background-color: #fff;
  border-radius: 4px;
  box-shadow: 1px 2px 3px rgba(0, 0, 0, 0.1);
  opacity: 0.3;
}

.mockup-list__wave-loader {
  position: relative;
  overflow: hidden;
  background: linear-gradient(to right, #fff, #BDECF2, #fff);
  width: 50%;
  height: 100%;
  animation: wavemove 2s infinite;
}

.tabs .fixed-width {
  width: 1024px;
  max-width: 100%;
  margin: 0 auto;
}

.tabs__nav {
  position: relative;
  z-index: 1;
  padding: 15px 20px 0;
  background-color: #ffffff;
  overflow: hidden;
  list-style: none;
  box-shadow: 0 1px 3px rgba(143, 164, 177, 0.3);
