  font-size: 13px;
  font-weight: 500;
  text-transform: uppercase;
  transition: color .2s;
}

.tabs__nav a:first-child {
  margin-left: 0;
}

.tabs__nav a.active {
  color: #1FBDD0;
}

.tabs__nav a i {
  vertical-align: middle;
  margin-right: 4px;
  font-size: 18px;
  color: #aaa;
}

.tabs__nav.transparent {
  background-color: transparent;
  box-shadow: none;
  border-bottom: 1px solid #CCD6DD;
}

.tabs__nav.transparent a {
  color: #1FBDD0;
}

.tabs__nav.transparent a.active {
  color: #363C4A;
}

.tabs__nav-wrapper {
  position: relative;
  display: inline-block;
}

.tabs__indicator {
  position: absolute;
  bottom: 0;
  height: 2px;
  background: #1FBDD0;
}

.tabs__indicator.to-left {
  transition: left .4s, right .4s .1s;
}

.tabs__indicator.to-right {
  transition: left .4s .1s, right .4s;
}

.tabs__actions {
  float: right;
  line-height: 43px;
}

.tabs__content {
  position: relative;
  padding: 16px;
  transition: width .5s;
}

.tabs__content--scrollable {
  position: absolute;
  overflow: auto;
}

.tabs__content--no-padding {
  padding: 0;
}

.tabs .fa-stack[data-count]:after {
  position: absolute;
  right: 0%;
  top: 1%;
  content: attr(data-count);
  font-size: 70%;
  padding: .6em;
  border-radius: 999px;
  line-height: .75em;
  color: white;
  background: #E96D76;
  text-align: center;
  min-width: 2em;
  font-weight: bold;
}

.sliding-panel {
  position: fixed;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  z-index: 20;
  background-color: rgba(0, 0, 0, 0.3);
  transition: background-color .5s;
}

.sliding-panel:not(.sliding-panel--opened) {
  visibility: hidden;
  background-color: transparent;
  transition: background-color .5s, visibility 0s .5s;
}

.sliding-panel__close {
  display: block;
  position: absolute;
  cursor: pointer;
  top: 10px;
  right: 40px;
  z-index: 1;
  border-radius: 50%;
  color: #8FA4B1;
  font-size: 20px;
  padding: 5px;
}

@media screen and (max-width: 1400px) {
  .sliding-panel__close {
    top: 8px;
  }
}

.sliding-panel__close:hover {
  background-color: #DEE6EB;
}

.sliding-panel__wrapper {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  width: 80%;
  background-color: #fff;
  transition: right .5s;
}

