  }
}

.sliding-panel--is-narrow .sliding-panel__wrapper {
  width: 400px;
}

.sliding-panel--is-middle .sliding-panel__wrapper {
  width: 600px;
}

.sliding-panel:not(.sliding-panel--opened) .sliding-panel__wrapper {
  right: -80%;
}

.sliding-panel:not(.sliding-panel--opened).sliding-panel--is-narrow .sliding-panel__wrapper {
  right: -400px;
}

.sliding-panel:not(.sliding-panel--opened).sliding-panel--is-middle .sliding-panel__wrapper {
  right: -600px;
}

.sliding-panel__outside {
  position: absolute;
  top: 0;
  left: 0;
  height: 100%;
  width: 100%;
  z-index: -1;
}

.sliding-panel--is-narrow .sliding-panel__outside {
  width: calc(100% - 400px);
}

.sliding-panel__header {
  position: relative;
  height: 50px;
  padding: 0 30px;
  line-height: 50px;
  color: #8FA4B1;
  background-color: #EFF3F5;
