  height: calc(100% - 114px);
}

.sliding-panel__body--close-btn-top-padding {
  padding-top: 56px !important;
}

.sliding-panel__footer {
  position: relative;
  height: 64px;
  padding: 0 30px;
  line-height: 64px;
  border-top: 1px solid #c6cfd1;
}

