.logs-viewer {
  font: normal 13px/1.2 'Courier', sans-serif;
  line-height: 20px;
  height: 100%;
  overflow: hidden;
}

.logs-viewer__container {
  height: 100%;
}

.xterm-theme-ax {
  background-color: transparent;
  color: #495763;
}

.xterm-theme-ax .xterm-viewport {
  background-color: transparent;
}

.xterm-theme-ax .terminal-cursor {
  background-color: transparent !important;
}

.popup-overlay {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 200;
  background-color: rgba(222, 222, 222, 0.62);
  /*dim the background*/
  border: 1px solid #CCD6DD;
}

.popup-overlay .popup-container {
  position: relative;
  box-shadow: 3px 3px 20px #888888;
  margin: 0 auto;
  top: 50%;
  transform: translateY(-50%);
  min-width: 400px;
  max-width: 1000px;
  max-height: 600px;
  z-index: 20;
  border-radius: 8px;
}

.popup-overlay .popup-container__header {
  line-height: 60px;
  padding-left: 30px;
  height: 60px;
  border-top-right-radius: 8px;
  border-top-left-radius: 8px;
}

.popup-overlay .popup-container__header h2 {
  margin-left: 5%;
  line-height: 50px;
}

.popup-overlay .popup-container__header i {
  font-size: 21px;
  float: right;
  position: absolute;
