.select {
  position: relative;
}

.select__focus-receiver {
  width: 0;
  height: 0;
  display: block;
  border: none;
  background: transparent;
}

.select__value {
  position: relative;
  padding: 8px 20px 8px 0;
  font-size: 15px;
  border-bottom: 2px solid #ccc;
  transition: border .2s;
  cursor: pointer;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}

.select__value-arrow {
  position: absolute;
  top: 8px;
  right: 0;
}

.select__options {
  position: absolute;
  top: 0;
  right: 0;
  left: 0;
  z-index: 10;
  overflow: auto;
  max-height: 320px;
  background-color: #ffffff;
  box-shadow: 0 0 4px rgba(0, 0, 0, 0.2);
  transition: opacity .2s, transform .2s, visibility .2s;
}

.select__options.to-top {
  top: auto;
  bottom: 0;
}

.select__options:not(.opened) {
  transform: translateY(-30%);
  opacity: 0;
  visibility: hidden;
  transition: opacity .2s, transform .2s .2s, visibility .2s;
}

.select__search {
  width: 100%;
  padding: 10px 12px;
  color: #8FA4B1;
  border: 0;
  background: transparent;
}

.select__search::placeholder {
  color: #CCD6DD;
}

.select__option {
  padding: 10px 12px;
  color: #6D7F8B;
  cursor: pointer;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}

.select__option:hover {
  background-color: #F8FBFB;
}

.select__option.selected {
  background-color: #EFF3F5;
}

.select__empty {
  padding: 10px 12px;
  color: #CCD6DD;
}

