.argo-button[axButtonWave] .wave {
  width: 0;
  height: 0;
  border-radius: 50%;
  background: rgba(255, 255, 255, 0.4);
  transform: scale(0);
  position: absolute;
  opacity: 1;
  animation: rippleDrop .6s linear;
}

@keyframes rippleDrop {
  100% {
