.argo-button-close {
  display: block;
  width: 2em;
  height: 2em;
  border-radius: 50%;
  outline: 0;
  cursor: pointer;
}

.argo-button-close::before,
.argo-button-close::after {
  position: absolute;
  top: 50%;
  left: 0.475em;
  width: 1em;
  height: 1px;
  background: #999;
  content: '';
}

.argo-button-close::before {
  transform: rotate(45deg);
}

.argo-button-close::after {
  transform: rotate(-45deg);
