.argo-radio input + span {
  display: inline-block;
  vertical-align: middle;
  width: 20px;
  height: 20px;
  margin-right: 6px;
  padding-top: 4px;
  border-radius: 50%;
  border: 2px solid #777;
  transition: background-color .2s, border-color .2s;
}

.argo-radio input:checked + span {
  background-color: #1FBDD0;
  border-color: #1FBDD0;
  box-shadow: inset 0 0 0 3px #F8FBFB;
}

.argo-checkbox-slide {
  position: relative;
  display: inline-block;
}

.argo-checkbox-slide + label {
  cursor: pointer;
}

.argo-checkbox-slide input {
  position: absolute;
  width: 30px;
  height: 20px;
  z-index: 1;
  opacity: 0;
  cursor: pointer;
  top: 50%;
  transform: translateY(-50%);
}

.argo-checkbox-slide input + span {
  position: relative;
  top: 3px;
  display: inline-block;
  width: 30px;
  height: 14px;
  margin-right: 6px;
  background-color: #e3e3e3;
  border-radius: 7px;
  box-shadow: inset 1px 1px 2px #aaa;
}

.argo-checkbox-slide input + span::before {
  position: absolute;
  top: -2px;
  left: -2px;
  display: inline-block;
  vertical-align: middle;
  width: 18px;
  height: 18px;
  background-color: #fff;
  border-radius: 50%;
  box-shadow: 0 1px 2px #999;
  transition: left .2s;
  content: '';
}

.argo-checkbox-slide input:checked + span {
  background-color: #98e6f0;
}

.argo-checkbox-slide input:checked + span::before {
  left: 16px;
  background-color: #1FBDD0;
  box-shadow: 0 1px 2px #fff;
}

